import React, { useState, useEffect } from 'react';
import './InvoiceDoc.scss';
import PropTypes from 'prop-types';
import { connect } from 'react-redux';
import { getInputValueByLabelIfVisible } from '../../components/form/utils/customFormQueries';

const InvoiceDoc = ({ profile }) => {
    // const p_name = getInputValueByLabel(profile.details, 'Name');
    const p_name = getInputValueByLabelIfVisible(profile.details, 'Name');
    return (
        <article id='invoice'>
            <header className='bg'>
                <div>
                    <h1>invoice</h1>
                </div>
                <div className='txt--right'>{p_name && <b>{p_name} </b>}</div>
            </header>
            {}
        </article>
    );
};

InvoiceDoc.propTypes = {};
const mapStateToProps = (state) => ({
    profile: state.profile,
});

export default connect(mapStateToProps)(InvoiceDoc);
